import React from "react";

export const ContactPicker = ({contacts, name, value, onChange}) => {
  return (
    <>
    <select onChange={onChange} value={value} name={name}>
      <option value="" selected disabled hidden>No Contact Selected</option>
      {contacts.map((contact) =>  <option value={contact} key={contact}>{contact}</option>)}
    </select>
    </>
  ); 
};
